import { Routes, Route, Outlet } from 'react-router-dom'
import Home from './routes/home/home.component'

const NavBar = () => {
  return(
    <div>
      <div>
        <h1> Nav Bar</h1>
      </div>
      <Outlet />
    </div>
  )
}

const App = () => {
  return (
    <Routes>
      <Route path='/' element={<NavBar/>}/>
        <Route path='/' element ={ <Home />} />
    </Routes>
  );
}

export default App;
